import React from "react";
import styled from "styled-components";

const DetailBox = styled`
    border:1px solid #eee;


    width:500px;
    height:40px;

    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
`;

const Box1 = styled`
    display: flex; 
    flex-direction: row;
    justify-content: center;
    align-items: center;
`;

const DetailBtn = styled`
    border:1px solid #eee;
    border-radius: 3px;


`;

function Detail() {
  return (
    <DetailBox>
      <Box1>
        <p>id: 01</p>
        <button className="DetailBtn" type="button">
          이전으로
        </button>
      </Box1>
    </DetailBox>
  );
}

export default Detail;
